B.BN=new A.fM("Combination Therapy","Some chronic pain sufferers, such as patients with fibromyalgia, are placed on a variety of medications \u2013 which means taking multiple drugs. Compounding can make it possible for these patients to get all their medications in a single preparation, which is much more convenient.",null,null,null)
B.BO=new A.fM("Pyramids And Compounding","Pyramids Pharmacy is a leading specialty pharmacy dedicated to providing our patients and healthcare provider partners with a level of commitment and service that stands apart from other specialty pharmacies in the healthcare industry.\nOur team at Pyramids Pharmacy works closely with providers, and payers to manage treatment from start to finish. We work hard to eliminate administrative and clinical burdens placed on physicians when they need to prescribe a specialty medication. We can take on much of the work involved in securing prior authorizations for your patients, easing this burden so that you and your staff can focus on providing quality care, and ensuring that your patients receive access to medications as soon as possible.",null,null,null)
B.BP=new A.fM("Is Compounding Legal?","The Food and Drug Administration has stated that compounded prescriptions are both ethical and legal as long as they are prescribed by a licensed practitioner for a specific patient and compounded by a licensed pharmacy. In addition, compounding is regulated by state boards of pharmacy.",null,null,null)
B.BQ=new A.fM("No two women are alike, and compounding pharmacists understand this.","A pharmacist experienced in HRT can assist a health care provider in interpreting the results of tests that measure a patient\u2019s hormone levels. The health care provider, compounding pharmacist and patient can then determine a course of treatment that will give the patient the exact amount of hormones her body needs. Working closely with the patient and her health care provider, a compounding pharmacist can help her start and maintain a hormonereplacement regimen that brings her hormones back into balance and closely mimics what her body has been doing naturally for years. With a health care provider\u2019s prescription, the pharmacist can prepare hormones in a variety of strengths and dosage forms. Thanks to compounding, there are customized hormone prescriptions to meet your specific needs. And that\u2019s power of personalized medicine.",null,null,null)
B.BR=new A.fM("Does My Insurance Cover Compounding Medications?","Pyramids Pharmacy works closely with both providers and payers to help manage and eliminate burdens in prescribing compounded medications, including obtaining prior authorizations for compounded medications. Every prescription insurance plan is unique. Some insurance plans cover compounds directly at the pharmacy counter, and others may require the patient to submit a claim form. You should contact your prescription plan to see what their coverage is for your customized medication.",null,null,null)
B.BS=new A.fM("The Compounding Advantage","Pharmacy compounding is the preparation of customized medications for patients. The advantage of compounded hormone replacement therapy (HRT) is that it can be adapted specifically to fit each individual\u2019s body and hormone levels. Bio-identical hormones have the exact chemical structure as the hormones in the human body. The body recognizes them and allows them to mimic the function of the hormones the body produces on its own.",null,null,null)
B.BT=new A.fM("Strength Variations","Because patients vary in size, symptoms and pain tolerance, commercially available medications sometimes may not provide the appropriate dosage strength for an individual patient. Through compounding, a physician and pharmacist can customize the dosage to the exact amount the patient requires, and find a dosage form that best suits the patient\u2019s needs. Pain can be debilitating, whether it\u2019s acute muscle or nerve pain resulting from an accident, or a chronic condition such as arthritis or fibromyalgia. Pharmacy compounding may help improve a patient\u2019s quality of life by providing relief with potentially fewer side effects and less overall medication.\nA caring health care provider working closely with a compounding pharmacist can help manage chronic pain. Ask your health care provider or pharmacist about compounded medications today.",null,null,null)
B.BU=new A.fM("Alternative Dosage Forms","Some have difficulty taking pain medications in their commercially available forms due to stomach irritation or other side effects. Compounding can provide alternative methods of delivery to make the process easier. Instead of a capsule or tablet, a topical gel, cream or spray can be compounded to be applied directly to the site of the pain and absorbed through the skin. Also, dosage forms like nasal sprays, custom-flavored troches that dissolve under the tongue or suppositories are alternative possibilities.\nThese dosage forms bypass the gastrointestinal tract, helping patients with stomach irritation as well as those who have difficulty swallowing pills. In some cases, these delivery methods may allow for a smaller dose of the drug to be taken, which can reduce side effects like dizziness and drowsiness.",null,null,null)
B.GA=A.a(s(["Bioidentical hormone replacement therapy","Hospice","Pediatrics","Pain management","Ophthalmics","Dentistry","Otic (for the ear)","Dermatology","Medication Flavoring","Neuropathy","Sports medicine","Infertility","Wound and scar therapy","Podiatry","Gastroenterology"]),t.s)
B.BV=new A.fM("What Kind of Medications Can Be Compounded?","Compounding pharmacists can prepare medication for a variety of needs and applications, including:",B.GA,"Ask your physician or pharmacist about compounded medications today.",null)
B.BW=new A.fM("The Compounding Solution","Compounding is the preparation of customized medication. It provides valuable benefits to many patients, including those for whom dealing with chronic pain has become a way of life. Because it\u2019s personalized to the specific patient, compounded medication can treat symptoms while avoiding certain side effects. By working with a compounding pharmacist, your physician can prescribe treatments tailored specifically for your pain management needs.",null,null,null)
